import React from "react";
import "./materialize.min.css";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <div className="row nav-wrapper">
          <nav className="transparent">
            <ul className="black-text">
              <li>
                <a href="#">Services</a>
              </li>
              <li>
                <a href="#">Profile</a>
              </li>
              <li>
                <a href="#">Portfolio</a>
              </li>
              <li>
                <a href="#">Interests</a>
              </li>
              <li>
                <a href="#">Pricing</a>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    );
  }
}

export default App;
